  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains the 2000-era and
  2005-era classifications of US Gulf Coast, zone 46 and can be used to analyze change.
  This imagery was collected as part of the Multi-Resolution Land Characteristics
  program in a multi-agency effort to provide baseline multi-scale environmental characteristics
  and to monitor environmental change. This data set utilized 72 full or partial Landsat
  5 and 7 scenes which were analyzed according to the Coastal Change Analysis Program
  (C-CAP) protocol to determine land cover.\",\n\t\"license_title\": null,\n\t\"extras\":
